def _get_with(self, key):
    # other: fancy integer or otherwise
    if isinstance(key, slice):
        # _convert_slice_indexer to determin if this slice is positional
        #  or label based, and if the latter, convert to positional
        slobj = self.index._convert_slice_indexer(key, kind="getitem")
        return self._slice(slobj)
    elif isinstance(key, ABCDataFrame):
        raise TypeError(
            "Indexing a Series with DataFrame is not "
            "supported, use the appropriate DataFrame column"
        )
    elif isinstance(key, tuple):
        return self._get_values_tuple(key)

    # Check for boolean or scalar values
    if is_scalar(key) or is_bool(key):
        return self.loc[key]

    # Convert to a list for operations
    if not is_list_like(key):
        key = [key]

    if isinstance(key, (Index, np.ndarray, ExtensionArray, Series)):
        key_type = type(key).__name__
    else:
        key_type = lib.infer_dtype(key, skipna=False)

    if key_type in ["Int64Index", "integer", "int_"]:
        return self.iloc[key]
    elif key_type in ["RangeIndex", "numeric"]:
        return self.iloc[key]
    elif key_type == "boolean":
        return self.loc[key]
    elif key_type in ["Int64Index", "integer", "int_", "Int64", "datetime64", "Timedelta", "floating"]:
        return self.iloc[key]

    return self.reindex(key)
